import React from 'react'
import { useState } from 'react'
import Calendar from 'react-calendar'

function Ccalendar() {
  const [date, setDate] = useState(new Date())
  return (
    <Calendar onChange={setDate} selectRange={true} value={date}/>
  )
}

export default Ccalendar
